import React from 'react';
import logo from './images/logo.svg';
import './App.css';
import Login from './components/Login';

function App() {
  return (
    <div className="App">
		<div>
			<img src={logo} />
			<h3>onOne</h3>
		</div>
		<Login></Login>
    </div>
  );
}

export default App;
